import React from 'react';
import { View, Text, StyleSheet, Button } from 'react-native';

const ColorScreen = () => {
  return (
    <View>
      <Text>Color Screen</Text>
      <Button title="Add a Color" />
    </View>
  );
};

const styles = StyleSheet.create({});

export default ColorScreen;
